import Nav from "./Components/Nav/Nav";
import {Route, Router, BrowserRouter, Routes} from "react-router-dom";
import Footer from "./Components/Footer/Footer";

function App() {
  return (
      <>
      <Nav />
      <BrowserRouter>
        <Route></Route>
      </BrowserRouter>
      <Footer />
      </>
      );
}
export default App;
